import './App.css';
import './index.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  return (
    <div>
      <p class="container">
        <img src='imgAviao.jpg' />
      </p>
      <span class="container body-content teste">
        <span>
        <h2>Cadastro</h2>
        <p>
          Faça o seu cadastro aqui na Agência de<br />
          Viagem, aqui você pode realizar seu sonho,<br />
          todos seus dados estão seguros em nosso<br />
          banco de dados, click no botão abaixo e faça<br />
          seu cadastro.
        </p>
        <p class="text-left"><a class="btn btn-primary" href="#">Cadastrar &raquo;</a></p>
        </span>

      </span>

    </div>
  );
}

export default App;
